import React from "react";
// import { useState,useEffect } from "react";
import "./tweet.css";
import Tweet from "./tweet.json"
function Twitter() {
    console.log(Tweet);
    return (
        <div className="flex-container">
            <div>
                <h3>Twitter Scams.....</h3>
            </div>
            <div className="cards-tweets">
                <div className="cardtweets">
                    <div className="details">
                   <p> id:{Tweet && Tweet[0].id}</p>
                   <p> name:{Tweet && Tweet[0].name}</p>
                   <p> totaltweet:{Tweet && Tweet[0].tweet}</p>
                   <p> profile:{Tweet && Tweet[0].tweet}</p>
                {/* <h3>Twitter</h3> */}
                </div>
                </div>

                <div className="cardtweets">
                {/* <h3>Twitter</h3> */}
                <p> id:{Tweet && Tweet[1].id}</p>
                   <p> name:{Tweet && Tweet[1].name}</p>
                   <p> totaltweet:{Tweet && Tweet[1].tweet}</p>
                </div>
                <div className="cardtweets">
                {/* <h3>Twitter</h3> */}
                <p> id:{Tweet && Tweet[2].id}</p>
                   <p> name:{Tweet && Tweet[2].name}</p>
                   <p> totaltweet:{Tweet && Tweet[2].tweet}</p>
                </div>
            </div>
            </div>
    );
}

export default Twitter;
